import React from "react";
import { Link } from "wouter";
import "./MoreUsed.css"

const redirections = [
    {name:"Matrix Gifs", link:"/gifs/matrix"},
    {name:"Rick and Morty", link:"/gifs"},
    {name:"Platzi", link:"/"}
];


const MoreUsed = () =>{
    return(
        <div className="MoreUsed mb-4">
            <h3>More Used</h3>
            <div className="row">
                {redirections.map(redirection => (
                    <Link href={redirection.link} >
                        <a className="col-4">{redirection.name}</a>
                    </Link>
                ))}
            </div>
        </div>
    )
}


export default MoreUsed;
